import React from 'react'

function TopBar(props)
{
    console.log(Object.keys(props.social))
    return(
        <div id="top-bar">
            <img id="logo" src={props.avatarUrl} alt="Logo"/>
            <h1 id="company-name">{props.name}</h1>
            <ul id="social-ul">
                {Object.keys(props.social).forEach(site => {
                    return <li className="social-link"><a href={props.social[site]}>site</a></li>
                })}
            </ul>
        </div>
    )
}

export {TopBar}
